select * from pessoa;
delete from pessoa;
alter table pessoa auto_increment = 1;
desc pessoa;


	#Consulta de clientes de Belo Horizonte
	select e.nome as 'Estado', c.nome as 'Cidade', p.nome as 'Cliente'
    from pessoa p, cidade c, estado e
    where p.codigoCidade = c.codigo
    and c.codigoEstado = e.codigo
    and c.nome = 'Belo Horizonte'
    order by p.nome;
    
    #COMANDO JOIN - Jeito melhor de fazer o que foi feito acima
    select e.nome as 'ESTADO', c.nome as 'CIDADE', p.nome as 'PESSOA'
    from pessoa p
    join cidade c on (c.codigo = p.codigoCidade and c.nome = 'Belo Horizonte')
    join estado e on (e.codigo = c.codigoEstado)
    order by p.nome;
    
    #Consulta join - estado, cidade e clientes do RS, ordenado por estado crescente e nome da pessoa decrescente
    select e.sigla as 'ESTADO', c.nome as 'CIDADE', p.nome as 'PESSOA'
    from pessoa p
    join cidade c on (c.codigo = p.codigoCidade)
    join estado e on (e.codigo = c.codigoEstado and e.sigla = 'RS')
    order by c.nome asc, p.nome desc;
    
    select p.nome as 'PESSOA', concat(c.nome, ' - ', e.sigla) as 'LOCAL'
    #Função concat - junta dois dados em uma só informação na tabela (neste caso, cidade e estado)
    from pessoa p
    join cidade c on (c.codigo = p.codigoCidade)
    join estado e on (e.codigo = c.codigoEstado and e.sigla = 'RS')
    order by c.nome asc, p.nome desc;
    
	select c.nome as 'CIDADE', p.nome as 'PESSOA'
    from pessoa p
    join cidade c on (c.codigo = p.codigoCidade and c.codigo = 4237) #ou c.nome = 'Porto Alegre', prof usou código
	order by p.nome;
    
	select c.nome as 'CIDADE', count(c.codigo) as 'TOTAL'
    #função count, aqui conta número de pessoas em Porto Alegre
    from pessoa p
    join cidade c on (c.codigo = p.codigoCidade and c.codigo = 4237); #ou c.nome = 'Porto Alegre', prof usou código
	#order by p.nome; - um resultado, não precisa disso
    
    #GROUP BY
    select c.nome as 'CIDADE', count(c.codigo) as 'TOTAL'
    from pessoa p
    join cidade c on (p.codigoCidade = c.codigo and c.codigoEstado = 23)
    group by c.nome; #ao invés de só aparecer o total de tudo junto, assim aparece o total por cidade
    
    create table pedido(
		codigo int primary key auto_increment,
		numero varchar(20) not null,
		dataPedido datetime,
		codigoPessoa int not null,
		foreign key (codigoPessoa) references pessoa(codigo)
    );
    desc pedido;

	create table categoria(
		codigo int primary key auto_increment,
		nome varchar(45) not null
    );
    desc categoria;
    
    create table produto(
		codigo int primary key auto_increment,
        nome varchar(45) not null,
        preco float(10,2),
        codigoCategoria int not null,
		foreign key (codigoCategoria) references categoria(codigo)
	);        
    
    create table pedido_produto(
		codigo int primary key auto_increment,
        codigoPedido int not null,
        codigoProduto int not null,
		foreign key (codigoPedido) references pedido(codigo),
		foreign key (codigoProduto) references produto(codigo)
    );
    
	create table telefone(
	   id int primary key auto_increment,
	   ddd varchar(45) not null,
	   numero varchar(45) not null,
	   tipo enum('C','R'),
	   codigoPessoa int not null,
       foreign key (codigoPessoa) references pessoa(codigo)
);

